import { Col, Content, Image, Layout, Row } from 'antd';
import React from "react";

const Profile = () => {
  return (
    <Row justify="center">

      <Col span={20}>
        <Image
          width={1000}
          src="http://localhost:3000/HR_employee.png"
        />
      </Col>
    </Row>
  );
};

export default Profile;
